import React from 'react';
import PropTypes from 'prop-types';
import '@vkontakte/vkui/dist/vkui.css';

import {Panel, PanelHeader, PanelHeaderBack, Div, Banner, Button} from '@vkontakte/vkui';

import { Icon28TargetOutline } from '@vkontakte/icons';

class TypeOfDonation extends React.Component {
    render() {
        const App = this.props.app;
        return (
            <Panel id={this.props.id}>
                <PanelHeader left={<PanelHeaderBack onClick={App.back}/>}>Тип сбора</PanelHeader>
                <Div className='absolute_centered'>
                    <Banner
                        header="Больше интересных подкастов в каталоге"
                        subheader="Найдите интересующие именно Вас подкасты!"
                        asideMode='expand'
                        onClick={App.go} data-to='type-of-donation'
                    />
                </Div>
            </Panel>
        );
    }
}

TypeOfDonation.propTypes = {
    id: PropTypes.string.isRequired,
    app: PropTypes.object
};

export default TypeOfDonation;
